    691: function(e, t) {
        e.exports = '<div>\n  <gh-common-aside></gh-common-aside>\n  <gh-common-prompt container="{{ mievCtrl.promptContainer }}"></gh-common-prompt>\n\n  <h1 class="c-menu-item-edit__header">\n    <span\n        class="c-menu-item-edit__header-mode c-menu-item-edit__header-mode--seperated">{{ mievCtrl.headerMode }}</span>\n    <span class="c-menu-item-edit__header-text">\n      {{ mievCtrl.headerText }}\n      <small class="c-menu-item-edit__header-status"\n             ng-if="mievCtrl.headerMode === \'Edit\' && !mievCtrl.status.isSoldout"\n             ng-class="{ \'c-menu-item-edit__header-status--orange\': mievCtrl.status.isArchived }">\n             {{ mievCtrl.status.isArchived ? \'Archived\' : \'Available\' }}\n      </small>\n      <small class="c-menu-item-edit__header-status c-menu-item-edit__header-status--orange"\n             ng-if="mievCtrl.headerMode === \'Edit\' && mievCtrl.status.isSoldout">\n             Returns {{ mievCtrl.status.soldoutEnd | date : \'EEEE, MMM d \' }}\n      </small>\n    </span>\n  </h1>\n  \n  \n    <gh-menu-item-editor restaurant-id="{{ mievCtrl.menuItem.menu.id }}"\n                         menu-item-id="{{ mievCtrl.menuItem.id }}"\n                         menu-item-template="mievCtrl.menuItemTemplate"\n                         clone-item="mievCtrl.cloneItem"\n                         is-super-admin="{{ mievCtrl.isCare }}"\n                         is-external-menus-editor="{{ mievCtrl.isExternalMenusEditor }}"\n                         hide-actions="true"></gh-menu-item-editor>\n\n  <div class="c-menu-item-edit__footer u-flex u-flex--center">\n    <div class="c-menu-item-edit__footer-delete"\n         ng-show="mievCtrl.menuItem.id"\n         ng-click="mievCtrl.deleteMenuItem()">\n      <svg>\n        <use xlink:href="#icon--delete" />\n      </svg>\n    </div>\n\n    <div class="c-menu-item-edit__quicksave" ng-if="!mievCtrl.menuItem.id">\n      <span class="c-menu-item-edit__quicksave-text">Quick save</span>\n      <div class="gh-toggle"\n           ng-click="mievCtrl.toggleQuickSave()"\n           ng-class="{ \'gh-toggle--on\': mievCtrl.quickSave }">\n        <span class="gh-toggle__state">{{ mievCtrl.quickSave ? \'On\' : \'Off\' }}</span>\n        <div class="gh-toggle__block"></div>\n      </div>\n    </div>\n\n    <button class="btn btn-default c-menu-item-edit__btn-back"\n            ng-click="mievCtrl.handleBackToMenu()">\n      <svg class="c-icon c-icon--small c-icon--arrow">\n        <use xlink:href="#icon--arrow-left" />\n      </svg>\n      Menu\n    </button>\n\n    <gh-common-button related-id="GHMenuItemEditor"\n                      related-type="save"\n                      button-text="Save Item"\n                      is-submit="true"\n                      disabled="true"\n                      classes="c-gh-button__success c-menu-item-edit__btn-save"\n                      ng-click="mievCtrl.saveMenuItem()">\n    </gh-common-button>\n\n    <a class="c-menu-item-edit__help-link" ng-href="{{::mievCtrl.GHCommonConfigurationService.get(\'GHMenu.helpCenterLocation\')}}"\n       target="_blank" ng-if="mievCtrl.showHelp">\n      <svg class="c-menu-item-edit__help-icon gh-menu-icon">\n        <use xlink:href="#icon--help" />\n      </svg>\n    </a>\n  </div>\n</div>\n'
    },
